import './App.css';
import AxiosInstance from './Axios';
import Logout from './components/Logout';
import Nav from './components/Nav';
import { useEffect } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";
import { useState } from 'react';
import {Typography, Grid, Container} from '@material-ui/core';
import LoginModal from './components/LoginModal';

function Content(){
  const [title, setTitle] = useState("");

  useEffect(() => {
    AxiosInstance
      .get("/api/users/")
      .then((res) =>{
        const rest = res["data"]["results"][0]["username"];
        setTitle(rest);
        console.log(res);
      })
      .catch((error)=>{
        setTitle("error");
        console.log(error);
      });
  });


  return(
    <div>
      <Typography variant = "h1">{title}</Typography>
      <Link to = "Logout">Log out</Link>
    </div>
  )
}

function App() {


  return(
    <div className = "front-class">
      <Router>
        <Container maxWidth = "lg">
          <Grid container spacing = {3}>
            <Grid container item direction = "column" xs = {3}>
              <Nav/>
            </Grid>
            <Grid container item xs = {9}>
              <Switch>
              <Route path = "/home" exact>
                <Home />
              </Route>
              <Route exact path="/">
                <Redirect to="/home" /> 
              </Route>
              <Route path = "/about">
                <About />
              </Route>
              <Route path = "/content">
                <Content />
              </Route>
              <Route path = "/logout">
                <Logout/>
              </Route>
            </Switch>
            </Grid>
          </Grid>
        </Container>
      </Router>
    </div>
  );
}

export default App;

function Home() {
  return (
    <div className="App">
      <LoginModal text = "open" initial = "Login"></LoginModal>
    </div>
  );
}

function About(){
  return <h1>About</h1>;
}
